import React from 'react';
import drinks from './drinks.jpg'
import './Body.css'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';



function Adminlist (props)  {

    

    return (   
                
                <div className="item col-md-10 col-sm-20"  style={{border:'solid', marginRight:'1.5%', marginLeft:'1.5%', marginTop:'2%', borderRadius:'5%', backgroundColor:'#F1EFEF'}}>
                    <p><b>ID : {props._id}</b></p>
                    <p><b>Username : {props.username}</b></p>
                    <p><b>Name : {props.name}</b></p>
                    <p><b>Address : {props.address}</b></p>
                    <p><b>Phone : {props.phone}</b></p>
                    <p><b>Email : {props.email}</b></p>
                    <p><button className='btn btn-primary' type="button" onClick={handleClick}  variant="primary" style={{borderRadius:'10px',width:'auto',height:'auto'}}>Add To Cart</button></p> 
                </div>  

    )   
    
    }

export default Adminlist;
